Imovel.Descricao:
O Praia do Moçambique Residence é o mais novo condomínio horizontal fechado de alto padrão da grande Florianópolis. 

Você terá o prazer de estar perto da natureza e com a comodidade de um resort. 



Estação de tratamento de esgoto própria; 

Playground;

Gazebos com churrasqueiras;

Quadra de tênis;

Campo de futebol;

Salão de festas;

Piscina adulto e infantil;

Fitness center;

Ecogym;

Espaço gourmet;

Vestiários;

Espaço luau com lareira a gas;

Ilha de relaxamento;

Piscina semi-olímpica aquecida;

Horta;

Sala de spa;

Energia eólica e aproveitamento de água.

Com 120m² o apartamento possui as seguintes características:

-Boa localização com facilidade de saída para as praias;
-Próximo: à Lagoa da Conceição, UDESC, UFSC e shoppings;
-Apartamento com três dormitórios, sendo um suíte com sacada, banheiro com hidromassagem e closet;
-Outro banheiro que atende aos outros dois quartos e área social;
-Sala com três ambientes, cozinha ampla, área de serviço de bom tamanho;
-Uma garagem coberta;
-Prédio com um bloco apenas, quatro andares, seis apartamentos por andar, um elevador e salão de festas bem equipado e com churrasqueira.
 

Observação importante: semimobiliado (todos os móveis fixos ficarão).

