maravilhoso apartamento com vista para o mar, com 3 suítes,sala para 2 ambientes,3 vagas de garagem, altíssimo padrão,condomínio com piscina,área de lazer e linda vista.Características The View Club Residence
 
- Aspiração central instalado nos apartamentos;
- Porta de segurança na entrada dos aptos com fechadura eletrônica;
- Aquecedores de passagem digitais;
- Fechamento das sacadas (tipo reiki), espaço gourmet, SPA, e demais ajustes por conta da construtora.
- Preparação automação nos aptos;
- Vidros duplos nas janelas e portas janelas, garantindo tratamento termo/acústico, com  persianas automatizadas;;
- Lajes nervuradas com 30cm de espessura  diminuindo consideravelmente a reverberação acústica entre andares, mais  manta de tratamento acústico;
- Rodapés com 20cm de altura em poliestireno;
- Todas as portas serão trabalhadas e com  borrachas de vedação e ferragens de alta qualidade;
- Banheiros equipados com registros tipo  mono comando e piso aquecido;
- Pisos dos apartamentos com tamanhos grandes, porcelanato polido, e ou laminado de madeira nas áreas íntimas;
- Elevadores de última geração equipados com sistema de resgate automático em caso de falta de luz, e com biometria/senha para segurança;
- Cisterna com capacidade de 35.000 litros de água potável;
- Decoração dos tetos em gesso em todo o apartamento. (Aceitamos projetos dos arquitetos e design de interiores dos proprietários);
- Pé direito entre lajes de 3,6m;
- Hall de entrada finamente mobiliado e climatizado;
- Academia com mezanino e toda montada com equipamentos de marcas de qualidade (life fitness ou similar);
- Piscina com borda infinita, hidromassagem e aquecida;
- Health spa, com sauna seca,  a vapor e spa com cromoterapia;
- Home cinema equipado;
- Sports bar, equipado e mobiliado;
- Espaço gourmet com equipamentos de última geração e acessórios de primeira qualidade;
- Sistema automatizado de monitoramento por câmeras de segurança;
- Hall de entrada finamente decorado e mobiliado;
- Gerador de energia para as áreas comuns.

